                    'description' => '              <div class="container columns"> <div class="row">   <div class="large-12 medium-12 columns">     <p>VR Box virtual reality 3D glasses let you enter a world of spectacular immersion. This VR headset has an adjustable 3D lens for an optimum distance view.Revel in a brilliant, close up, out of the screen movie watching or gameplay with the VR Box Virtual Reality 3D Glasses. They are easy to set up and use and do not cause visual fatigue or dizziness due to their ergonomic make. The glasses can easily accommodate a 4.7 to 6inch screen phone. You will not feel visual fatigue and dizziness even after wearing them on for an extended period, thanks to the ergonomically shaped resin lens. It includes a Bluetooth remote control to help you change and adjust settings on your smartphone effortlessly. </p>   </div> </div> <div class="row"> <div class="large-12 medium-12 columns">   <h4> <b>Key Features</b>   </h4>   <div class="row kf-en">   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 fi-info"></p>       <p class="large-10 medium-10 small-10">Virtual Reality Glasses</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-info"></p>       <p class="large-10 medium-10 small-10">Compatible with Smart Phones</p>     </div>   </div>   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 fi-info"></p>       <p class="large-10 medium-10 small-10">42mm spherical resin lens</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-bluetooth"></p>       <p class="large-10 medium-10 small-10">Bluetooth Remote control</p>     </div>   </div> </div> </div> </div>       <div class="row mart-30">         <div class="large-6 medium-12 text-center right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="VR headset" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/vr-box/virtual-reality-3d-glasses/1-vr-box-virtual-reality-3d-glasses-remote-control-gamepad.jpg" class="lazy"/></div>         <div class="large-6 medium-12 left columns mart-50">           <h4>Splendid 3D Content</h4>           <p>These VR Box virtual reality 3D glasses let your senses enjoy a theater like experience at home or on the go. Just insert your Android, or iOS device with screen size ranging from 4.7 to 6inch in it. You can play videos or games by searching for 3D split screen or Cardboard content from your devices. This VR headset makes the content look engaging without distorted picture quality. Its 360 degree panoramic views offers full, broad view without any cut out frames. With the included Bluetooth remote control and easy touch control of the glasses, you can quickly select viewing settings and play the content you want.</p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 text-center left columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="VR headset" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/vr-box/virtual-reality-3d-glasses/2-vr-box-virtual-reality-3d-glasses-remote-control-gamepad.jpg" class="lazy"/></div>         <div class="large-6 medium-12 right columns mart-50 padt-40">           <h4>Skillfully Made</h4>           <p>The intelligent sight distance adjustment of these VR Box 2.0 virtual reality glasses makes sure you get a clear view of the content the moment you put them on. The 42mm lens of the glasses is made using ABS and spherical resin, which lets you enjoy hours of nonstop viewing without strained or fatigued vision. The headband is made using soft, flexible materials for comfortable long hour wear without feeling dizzy.</p>         </div>       </div>     </div>         ',
