                    'description' => '              <div class="container columns"> <div class="row"> <div class="columns medium-12"> <p>The Infinix Hot 5 Lite Smartphone is all that you need to stay connected to the world. This smartphone has a perfect modern-day design with curved corners. The extremely smart looking smartphone is comfortable to hold. Viewing your favorite content is an absolute treat, thanks to the 5.5inch HD IPS display. The 4000mAh battery facilitates non-stop usage of the smartphone for a longer time, without the need of frequent charging. Store your memories and vital data at one location, with the ample storage size of 16GB. Capture images and videos in high-quality, with the 8MP rear and 5MP front camera. The XOS operating system that is based on Android N offers various interesting features such as data saver and split-screen chrome. The 1GB RAM ensures that multitasking is smooth and easy. It helps you load apps quickly and without any hassle. The MT 6580 GPU, by rendering smooth graphics makes your gaming experience worthwhile. The quad-core Cortex processor ensures that the overall performance of the smartphone never takes a fall. The various sensors such as G-sensor, E-compass, light sensor, and proximity sensor make your smartphone efficient. Arrange your contacts as per your requirements, with the dual SIM functionality of this smartphone. With Bluetooth 4.0 technology, transfer files quickly to the other compatible devices. Download data and browse the internet at a faster rate, courtesy of the 3G network support. The gold color offers a perfect finish and gives a luxurious look to your smartphone.</p> </div> </div> <div class="row"> <div class="columns medium-12"> <h4><b>Key Features</b></h4> <div class="row kf-en"> <div class="columns medium-6 small-12"> <div class="row"> <p class="medium-1 small-1 ic-storage"></p> <p class="medium-10 small-10">16 GB</p> </div> <div class="row"> <p class="medium-1 small-1 ic-ram"></p> <p class="me