v class="large-11 medium-11 columns text-center mart-10"> <h4><b>Capture Beautiful Moments</b></h4> <p>This Infinix smartphone is equipped with an 8MP rear and 5MP front camera, allowing you to capture beautiful images anytime, anywhere. The built-in flashlight gives you the freedom to click pictures in dark. </p> </div> </div> </div>  <div class="row mart-10"> <div class="columns large-6 medium-12 left text-center"><img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Hot 5 Lite Dual Sim" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/infinix/hot-5-lite/3-infinix-hot-5-lite-dual-sim-gold.jpg" class="lazy"/></div> <div class="columns large-6 medium-12 right"> <div class="mart-60 hide-for-small-only hide-for-medium-only"></div> <h4><b>Incredible Display and Design </b></h4> <p>The smartphone has a 5.5inch HD IPS display that delivers images that are pleasing to your eyes. Furthermore, you can view your favorite content for hours without experiencing any discomfort. The Infinix smartphone has a slim design that looks stylish and is comfortable to hold.</p> </div> </div> </div>         ',
