                33 => 
                array (
                    'id' => 34,
                    'locale' => 'en',
                    'product_id' => 17,
                    'name' => 'TP-Link TL-WA850RE 300Mbps Universal WiFi Range Extender',
                    'slug' => 'TP-Link-TL-WA850RE-300Mbps-Universal-WiFi-Range-Extender',
                    'description' => '              <div class="container"> <div class="row">   <div class="large-12 medium-12 pad-5">     <p>The TP LINK TL WA850RE 300Mbps Universal WiFi Range Extender conveniently expands the coverage of your WiFi by improving its signal strength, eliminating dead and slow zones in the process. The extender produces 300Mbps wireless 802.11n speeds, which is a must if you wish to stream smooth HD videos and music, or partake in intensive online gaming. The device features a Plug and Play design, and starts working as soon as you plug it into a socket and push the WPS button followed by the Range Extender button. The compact wall mounted extender can be easily deployed. Its miniature size facilitates you to set it up in even in tight corners. What\'s more, its Ethernet port allows the TL WA850RE to act as a wireless adapter to turn a wired device into a wireless one.</p>   </div> </div> <div class="row">   <div class="large-6 medium-6 columns">     <h4> <b>Physical Features</b>     </h4><div class="text-center">     <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Physical Features" data-src="https://cms.souqcdn.com/spring/images/2014/TP_Link/TL_WA850RE_300Mbps_WiFi_Range_Extender/dimensions.jpg" class="lazy"/></div></div> <div class="large-6 medium-6 columns">   <h4> <b>Key Features</b>   </h4>   <div class="row kf-en">   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 ic-wifi"></p>       <p class="large-10 medium-10 small-10">IEEE 802.11 b/g/n</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-social-windows"></p>       <p class="large-10 medium-10 small-10">Compatible with Win OS</p>     </div>   </div>   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 fi-social-apple"></p>       <p class="large-10 medium-10 small-10">MAC OS</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-ethernet"></p>       <p class="large-10 medium-10 small-10">Ethernet Port</p>     </div>   </div> </div> </div> </div>       <div class="row mart-30">         <div class="large-6 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Flexible Deployment" data-src="https://cms.souqcdn.com/spring/images/2014/TP_Link/TL_WA850RE_300Mbps_WiFi_Range_Extender/range_extender.jpg" class="lazy"/></div>         <div class="large-6 medium-12 left columns">           <h4>300Mbps Range Extender</h4>           <p>The TL WA850RE is designed to conveniently extend the coverage and improve the signal strength of an existing wireless network to eliminate dead zones, help users maintain an existing wireless network and vastly improve the network&rsquo;s coverage. With 300Mbps wireless 802.11n speeds, it is ideal for smooth HD video, music streaming and online gaming.</p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 small-centered medium-centered left columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Plug and Play" data-src="https://cms.souqcdn.com/spring/images/2014/TP_Link/TL_WA850RE_300Mbps_WiFi_Range_Extender/flexible_deployment.jpg" class="lazy"/></div>         <div class="large-6 medium-12 right columns">           <h4>Flexible Deployment</h4>           <p>The device\'s miniature size and wall mounted design make it easy to deploy and move flexibly. What\'s more, the TL WA850RE\'s profile function remembers previously paired wireless networks, meaning there is no need to reset the device when changing the paired router.</p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="" data-src="https://cms.souqcdn.com/spring/images/2014/TP_Link/TL_WA850RE_300Mbps_WiFi_Range_Extender/plug_and_play.jpg" class="lazy"/></div>         <div class="large-6 medium-12 left columns">           <h4>Plug and Play</h4>           <p>With no new wires or cables, within range of their existing wireless network, users can easily extend wireless coverage at a push of the WPS button on their router followed by the Range Extender button on the TL WA850RE or vice versa. An additional push of the pair button can quickly establish an encrypted connection with client devices.</p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 small-centered medium-centered left columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Ethernet Bridge" data-src="https://cms.souqcdn.com/spring/images/2014/TP_Link/TL_WA850RE_300Mbps_WiFi_Range_Extender/ethernet_bridge.jpg" class="lazy"/></div>         <div class="large-6 medium-12 right columns">           <h4>Ethernet Bridge</h4>           <p>The TL WA850RE\'s single Ethernet port enables the Extender to function as a wireless adapter to connect wired devices like Blu Ray players, gaming consoles, DVRs and Internet TVs. At the same time, the device can share the wireless network as well. </p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Smart Signal Indicator Light" data-src="https://cms.souqcdn.com/spring/images/2014/TP_Link/TL_WA850RE_300Mbps_WiFi_Range_Extender/smart_signal_indicator.jpg" class="lazy"/></div>         <div class="large-6 medium-12 left columns">           <h4>Smart Signal Indicator Light</h4>           <p>The 5 signal lights represent the current signal strength that TL WA850RE receives from existing router, which can help to find the right location to place the range extender so that the TL WA850RE can achieve the best possible range and performance of the network.</p>         </div>       </div>     </div>         ',
