                    'description' => '              <div class="container">    <div class="row">    <div class="large-6 medium-6 columns">      <p>The Sandisk 32GB Cruzer Blade USB Flash Drive is reliable and safeguards data effectively. The 32GB storage space is sufficient to accommodate large volumes of digital media files such as music compositions, video recordings, and more. The USB drive is compatible with many well known operating systems such as Windows, Macintosh and Linux. The SecureAccess software that is only supported by high end Windows and Macintosh operating systems protects your data from unauthorized access. The drive flaunts a sleek and compact design and makes it convenient for you to slide it in your pocket or carry bag while commuting.</p>  </div>    <div class="large-6 medium-6 columns">    <h4> <b>Key Features</b>    </h4>    <div class="row kf-en">    <div class="large-6 medium-6 small-12 columns">      <div class="row">        <p class="large-1 medium-1 small-1 fi-social-windows"></p>        <p class="large-10 medium-10 small-10">Compatible with Win OS</p>      </div>      <div class="row">        <p class="large-1 medium-1 small-1 fi-social-apple"></p>        <p class="large-10 medium-10 small-10">Compatible with MAC OS</p>      </div>    </div>    <div class="large-6 medium-6 small-12 columns">      <div class="row">        <p class="large-1 medium-1 small-1 ic-memory"></p>        <p class="large-10 medium-10 small-10">32 GB</p>      </div>    </div>  </div>  </div>  </div>        <div class="row mart-30">          <div class="large-6 medium-12 small-centered medium-centered right columns">            <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="SanDisk" data-src="https://cms.souqcdn.com/spring/images/2014/SanDisk/Cruzer_Blade_16gb_USB_Flash_Drive/sandisk.jpg" class="lazy"/></div>          <div class="large-6 medium-12 left columns">            <p>This drive offers a plug and play operation. Whenever the need arises to transfer your files, you simply have to plug it in the USB port and import the files onto the internal memory. A specific folder can be protected by a password. You no longer need to worry about the security of your files because the 128 bit AES encryption. The retractable USB connector prevents it from getting damaged when you are not using it.</p>          </div>        </div>      </div>           ',
