                41 => 
                array (
                    'id' => 42,
                    'locale' => 'en',
                    'product_id' => 21,
                    'name' => 'Tecno Phontom 8 Dual Sim - 64 GB, 6 GB Ram, 4G LTE, Blue',
                    'slug' => 'Tecno-Phontom-8-Dual-Sim---64-GB,-6-GB-Ram,-4G-LTE,-Blue',
                    'description' => '              <div class="container columns"><div class="row"><div class="large-12 medium-12 columns"><p>Tecno Phantom 8 Dual SIM sports a high powered front camera with a selfie flash. Tecno Phantom 8 possesses a large memory storage capability. The Tecno Phantom 8 Dual SIM comes in a compact 79.5mm package. Painted on the Diamond Fire Design of the Tecno Phantom 8 is a Galaxy Blue color. This gives the device a smart and fun-filled look. The rear cover of the device has a unique surface which reflects any light that shines on it, causing waves of light to dance on the surface during movement. The 5.7inch display with a full HD 1920 x1080p resolution adds to the visuals of the phone through its stunning images. The installed Android 7.0 platform halts the opening of unwanted applications as well as clears the junk files in your memory. This allows the advanced interface of the device to run seamlessly. The Phantom comes with Bluetooth, GPS, and 4G capabilities. Travel to over 200 countries and regions and receive the support of multiple bands to always stay connected. Blistering 300Mbps speeds on downloading data are available due to the LTE Cat 6 technology.</p></div></div><div class="row"><div class="large-6 medium-6 columns"><h4> <b>Physical Features</b></h4><div class="text-center"><img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Tecno Phantom 8 - Physical Features" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/tecno/phontom-8-dual-sim/0-phontom-8-dual-sim-dimensions-blue.jpg" class="lazy"/></div></div><div class="large-6 medium-6 columns"><h4> <b>Key Features</b></h4><div class="row kf-en"><div class="large-6 medium-6 small-12 columns"><div class="row"><p class="large-1 medium-1 small-1 ic-sim"></p><p class="large-10 medium-10 small-10">Dual SIM</p></div><div class="row"><p class="large-1 medium-1 small-1 ic-storage"></p><p class="large-10 medium-10 small-10">64GB</p></div><div class="row"><p class="large-1 medium-1 small-1 ic-ram"></p><p class="large-10 medium-10 small-10">6GB RAM</p></div></div><div class="large-6 medium-6 small-12 columns"><div class="row"><p class="large-1 medium-1 small-1 fi-telephone"></p><p class="large-10 medium-10 small-10">4G LTE</p></div><div class="row"><p class="large-1 medium-1 small-1 fi-camera"></p><p class="large-10 medium-10 small-10">Main Camera: 12MP + 13MP<br />Front Camera: 20MP</p></div><div class="row"><p class="large-1 medium-1 small-1 fi-battery-full"></p><p class="large-10 medium-10 small-10">3500 mAH</p></div></div></div></div></div><div class="row mart-30"><div class="large-6 medium-12 text-center right columns"><img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Tecno Phantom 8" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/tecno/phontom-8-dual-sim/1-phontom-8-dual-sim-blue.jpg" class="lazy"/></div><div class="large-6 medium-12 left columns"><div class="mart-30 hide-for-medium-only hide-for-small-only"></div><h4>Say Cheese</h4><p>Clicking high-quality selfies is possible with the 20MP front Auto-Focus camera. The images will be bright and capture you perfectly even in low-light conditions with the 2.0UM pixel effect. A double mode selfie flash accompanies the front-facing camera. The flash lights up your face while detecting your skin tone to find out just the right amount of illumination for a natural look. The dual rear Auto-Focus cameras, sport 12MP and 13MP each. These cameras work in tandem making your clicked photos richer and full of atmosphere. A 10x super digital zoom helps you capture greater detail in more distant images or sharp close-up photos.</p></div></div><div class="row mart-10"><div class="large-6 medium-12 text-center left columns"><img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Tecno Phantom 8" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/tecno/phontom-8-dual-sim/2-phontom-8-dual-sim-blue.jpg" class="lazy"/></div><div class="large-6 medium-12 right columns"><div class="mart-30 hide-for-medium-only hide-for-small-only"></div><h4>Processing Power and Memory</h4><p>With the 2.6 GHz Octa-Core, the Phantom 8 enables multitasking of up to 80 applications. The powerful MediaTek P25 Processor causes the device to have a faster data transmission speed while consuming less power. Sporting a 6GB RAM, 64GB ROM and an expandable microSD card up to 2TB, the phone has a near-limitless capacity which will serve you well throughout the years.</p></div></div><div class="row mart-10"><div class="large-6 medium-12 text-center right columns"><img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Tecno Phantom 8" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/tecno/phontom-8-dual-sim/3-phontom-8-dual-sim-blue.jpg" class="lazy"/></div><div class="large-6 medium-12 left columns"><div class="mart-30 hide-for-medium-only hide-for-small-only"></div><h4>Charging</h4><p>Worrying about long charge times is non-existent with the Phantom8, thanks to the reversible Type-C charger. The phone takes only 70 minutes to charge its 3500mAh battery. Either side of the reversible cable can be used without worrying about its orientation relative to the phone for easy linking.</p></div></div><div class="row mart-10"><div class="large-6 medium-12 text-center left columns"><img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Tecno Phantom 8" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/tecno/phontom-8-dual-sim/4-phontom-8-dual-sim-blue.jpg" class="lazy"/></div><div class="large-6 medium-12 right columns"><div class="mart-30 hide-for-medium-only hide-for-small-only"></div><h4>Sensory Feedback</h4><p>The Phantom has a multitude of sensors built into the device. Protect your device by giving only you access to it with the Fingerprint sensor. The G sensor and the Gyroscope sensor track the phone&rsquo;s movement and orientation. You can always tell which way is north with the help of the E-Compass sensor. The brightness of the screen changes with the Ambient Light sensor while the display switches on or off with the Proximity sensor.</p></div></div></div>         ',
