                    'name' => 'Johnson&#039;s Wipes Gentle All Over, Pack Of 20 Wipes',
                    'slug' => 'Johnson&#039;s-Wipes-Gentle-All-Over,-Pack-Of-20-Wipes',
                    'description' => '              <p>As your child grows, their skin needs special attention and care. Johnson\'s Baby Gentle All Over Wipes is designed with soft fabric enriched with baby lotion, leaving your baby&rsquo;s skin soft and cared for.</p><p>   </p><p>With clinically proven mildness, Johnson\'s Baby Gentle All Over Wipes is specially formulated to minimise the risk of allergies, and is as safe as pure water on new-born skin. Made with the NO MORE TEARS formula, these baby wipes are alcohol free and as gentle to your baby&rsquo;s eyes as pure water.</p><p>  </p><p>Johnson\'s baby care products. Trusted by moms for over 100 years!</p><p>  </p><p>Features &amp; Benefits:</p><p></p><ul><li>Clinically proven to be as safe &amp; gentle on new-born skin as pure water</li> <li>No More Tears formula is mild to the eyes</li> <li>Clinically proven mild</li> <li>Alcohol free</li> <li>Hypoallergenic</li> </ul><br /><p>Ingredients:<br />[PR-017125] Aqua, Glycerin, Polyglyceryl-2 Dipolyhydroxystearate, Carbomer, Coco-Glucoside, Lauryl Glucoside, Glyceryl Oleate, Hydrogenated Palm Glycerides Citrate, Glyceryl Polyacrylate, p-Anisic Acid, Citric Acid, Sodium Hydroxide, Tocopherol, Phenoxyethanol, Sodium Benzoate, Parfum </p><p></p><p>How to use:<br />Johnson\'s Gentle All Over Baby Wipes can be used all over new-born babies skin, including bottoms, hands and delicate faces. Simply open the pack by lifting the rigid lid, remove a Johnson\'s Gentle All Over Baby Wipe and clean your baby\'s skin. Close lid after use.</p><p></p><p>Safety warnings:<br />For external use only. Keep out of reach of children. Store in a dry place away from sunlight.</p><p></p><p>About the brand:<br />For over 125 years, Johnson\'s&nbsp;has provided safe, mild and gentle products for babies and adults. All Johnson\'s&nbsp;baby products are soap-free, hypoallergenic, dermatologist-tested and paraben-free as part of our promise to enable a healthy future for all babies. Every Johnson\'s product is made with the purest and highest-quality ingredients because we are committed to happy, healthy development.</p><p></p>         ',
