                    'description' => '              <div class="container columns"> <div class="row">   <div class="large-12 medium-12">     <p>Infinix Zero 4 mobile features 4G LTE network for a fast Internet connection from anywhere. This Infinix Zero smartphone has a 16MP rear and 8MP front camera.The Infinix Zero 4 X555 smartphone makes everything seem super easy and manageable. It is equipped with a 1.3GHz Octa Core CORTEX processor and 3GB RAM that lets you navigate, open, run apps, and multitask at a superior speed without any lag. If you use two phones or find it difficult to manage your work and personal contacts, with dual SIM card slots of this phone, you can seamlessly search for and switch between contacts from the comforts of a single device. The 4G LTE network lets you connect to the Internet, browse, stream, and download content speedily from any corner of the world. Capture life\'s crazy and memorable moments as and when they come with this Infinix Zero phone\'s superior 16MP rear and 8MP front camera. Both the cameras are incorporated with advanced features that give you picture perfect clicks. This mobile has a metal unibody that makes it elegant, sturdy, and amazingly smooth. </p>   </div> </div> <div class="row">   <div class="large-6 medium-6 columns">     <h4> <b>Physical Features</b>     </h4><div class="text-center">     <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Zero 4 X555 Dual Sim Physical Features" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/X555/0-infinix-zero-4-dual-sim-dimensions-gray.jpg" class="lazy"/></div></div> <div class="large-6 medium-6 columns">   <h4> <b>Key Features</b>   </h4>   <div class="row kf-en">   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 ic-sim"></p>       <p class="large-10 medium-10 small-10">Dual SIM</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-cpu"></p>       <p class="large-10 medium-10 small-10">Octa-Core 1.3 GHz</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-storage"></p>       <p class="large-10 medium-10 small-10">32 GB</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-camera"></p>       <p class="large-10 medium-10 small-10">Main Camera 16 MP <br /> Front Camera 8 MP</p>     </div>   </div>   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 fi-tablet-portrait"></p>       <p class="large-10 medium-10 small-10">5.5 Inch</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-ram"></p>       <p class="large-10 medium-10 small-10">3 GB RAM</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-battery-full"></p>       <p class="large-10 medium-10 small-10">3200 mAh</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-social-android"></p>       <p class="large-10 medium-10 small-10">Android 6.0 Marshmallow</p>     </div>   </div> </div> </div> </div>       <div class="row mart-30">         <div class="large-6 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Zero 4 X555 Dual Sim" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/X555/1-infinix-zero-4-dual-sim-gray.jpg" class="lazy"/></div>         <div class="large-6 medium-12 left columns">           <h4>Zero Gets a New Meaning </h4>           <p>The Infinix Zero 4 is super fast and glitch free as it operates on a 64 bit Octa Core CORTEX processor with a clock speed of 1.3GHz. It also features a 3GB RAM that quickens the pace of the CPU every time you enter a multitasking mode or open a file. The phone gets its neat screen and highly interactive interface with the preinstalled Android 6.0 Marshmallow operating system. In all, this device is apt in handling the heaviest of files and giving you smooth operations for all activities. So you can play a fast paced game, watch a movie, or switch to online browsing without any delay from slow operating speed or lag.</p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 small-centered medium-centered left columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Zero 4 X555 Dual Sim" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/X555/2-infinix-zero-4-dual-sim-gray.jpg" class="lazy"/></div>         <div class="large-6 medium-12 right columns">           <h4>Non Stop Entertainment</h4>           <p>The Infinix X555 phone has a big 5.5inch screen that displays every content in rich and vibrant picture quality. The screen is protected against scratches by a 2.5D TP third generation Corning Gorilla Glass. The phone is installed with a powerful 3200mAh battery that gets charged quickly with XCharge 3A PE plus 2.0 technology. And once fully charged, it provides amazing 300mins of voice calling, 80mins of video playback, 360mins of audio playback, and 70mins of gaming. With its integrated 32GB storage space, you can rely on this device to hold all your needed multimedia files comfortably. </p>         </div>       </div>       <div class="row mart-10">         <div class="large-6 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Zero 4 X555 Dual Sim" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/X555/3-infinix-zero-4-dual-sim-gray.jpg" class="lazy"/></div>         <div class="large-6 medium-12 left columns">           <h4>Camera Perfect</h4>           <p>The Infinix Zero smartphone features a 16MP rear camera with laser sharp autofocus for brilliant and clear photos. With its fast focus and Pro Mode manual camera controls, you get detailed and accurate pictures in the blink of an eye. It features 4X Sharper Zoom that lets you capture far away objects in crisp and crystal clear picture quality. The phone also has an 8MP front camera with panoramic selfie functionality, f/2.2 lens, and front facing flash, which captures you and the background with bright, clear, and sharp details.</p>         </div>       </div>     </div>         ',
