                    'description' => '              <div class="container columns"> <div class="row">   <div class="large-12 medium-12 columns">     <p>Infinix Hot 4 Pro is a dual SIM smartphone with support for 4G LTE network. This Infinix smartphone features a 2GB RAM and works without any lag. The Infinix Hot 4 Pro X556A is a smartphone that gives equal importance to work and entertainment. It comes in an anthracite gray finish and looks sophisticated in your palm. This dual SIM phone supports 4G LTE network that gives you the power of faster uploads and downloads. The Infinix Hot 4 Pro features a 5.5inch display that presents pictures and images at a detailed resolution of 720 x 1280 pixels. It has an internal storage of 16GB to save all your work and entertainment in one place. A 1.3GHz Quad Core CPU powers this smartphone and in couple with a MediaTek MT6737 chipset, it delivers one of the most seamless smartphone experience. The Infinix Hot 4 Pro X556 is equipped with a 2GB RAM that ensures a lag free performance. This smartphone features built in Bluetooth version 4.0 for easy sharing of music and movies with companions. The rear camera is of 13MP and lets you click crisp pictures while the front camera is of 5MP and is ideal for attractive selfies. And to make use of all the above features and more, the Infinix Hot 4 Pro packs in a 4000mAh Li Ion battery. </p>   </div> </div> <div class="row">   <div class="large-6 medium-6 columns">     <h4> <b>Physical Features</b>     </h4><div class="text-center">     <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Hot 4 Pro Physical Features" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/infinix-hot4-pro-x556-16gb-2gbram-lte-anthracite-grey/0-hot4-pro-x556-dimensions.jpg" class="lazy"/></div></div> <div class="large-6 medium-6 columns">   <h4> <b>Key Features</b>   </h4>   <div class="row kf-en">   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 ic-sim"></p>       <p class="large-10 medium-10 small-10">Dual SIM</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-cpu"></p>       <p class="large-10 medium-10 small-10">Quad-core 1.3 GHz</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-storage"></p>       <p class="large-10 medium-10 small-10">16 GB</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-camera"></p>       <p class="large-10 medium-10 small-10">Main Camera 13 MP <br /> Front Camera 5 MP</p>     </div>   </div>   <div class="large-6 medium-6 small-12 columns">     <div class="row">       <p class="large-1 medium-1 small-1 fi-tablet-portrait"></p>       <p class="large-10 medium-10 small-10">5.5 inches</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 ic-ram"></p>       <p class="large-10 medium-10 small-10">2 GB RAM</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-battery-full"></p>       <p class="large-10 medium-10 small-10">4000 mAh</p>     </div>     <div class="row">       <p class="large-1 medium-1 small-1 fi-social-android"></p>       <p class="large-10 medium-10 small-10">Android 6.0 Marshmallow</p>     </div>   </div> </div> </div> </div>       <div class="row mart-30">        <h4 class="text-center">Made to Perform</h4>         <div class="large-12 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Hot 4 Pro" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/infinix-hot4-pro-x556-16gb-2gbram-lte-anthracite-grey/1-hot4-pro-x556.jpg" class="lazy"/></div>         <div class="large-12 medium-12 text-center columns mart-10">                     <p>The Infinix Hot 4 Pro X556 runs on Android 6.0 Marshmallow OS that offers a user friendly experience. With a Mediatek MT6737 chipset offering a 1.3GHz, Quad Core processor, and a 64 bit address bus, this Infinix smartphone comes well equipped to cater to every high end work and entertainment demand of yours.  </p>         </div>       </div>       <div class="row mart-10">       <h4 class="text-center">Flawless Connectivity</h4>         <div class="large-12 medium-12 small-centered medium-centered left columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Hot 4 Pro" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/infinix-hot4-pro-x556-16gb-2gbram-lte-anthracite-grey/2-hot4-pro-x556.jpg" class="lazy"/></div>         <div class="large-12 medium-12 text-center columns mart-10">                      <p>Use the 4G LTE network and start on a downloading spree at blazing fast speeds. When in a hotspot zone, turn on the built in WiFi 802.11 a/b/g/n of the Infinix Hot 4 Pro and stream videos on YouTube or Skype with a friend. Also, this smartphone has a Bluetooth 4.0 that facilitates easy and quick sharing. </p>         </div>       </div>       <div class="row mart-10">       <h4 class="text-center">Crisp Clicks</h4>         <div class="large-12 medium-12 small-centered medium-centered right columns">           <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Infinix Hot 4 Pro" data-src="https://souqcms.s3.amazonaws.com/spring/images/2017/Infinix/infinix-hot4-pro-x556-16gb-2gbram-lte-anthracite-grey/3-hot4-pro-x556.jpg" class="lazy"/></div>         <div class="large-12 medium-12 text-center columns mart-10">                      <p>The Infinix Note 3 Pro features a 13MP rear camera, which enables you to capture every minute detail of the memorable moments in your life. Also, this Infinix smartphone has a 5MP secondary camera that lets you click glamorous selfies for Instagram.</p>         </div>       </div>     </div>         ',
