                        'description' => '              <div class="container columns"> 	<div class="row"> 		<div class="columns medium-12"> 			<p>The Black and Decker Coffee Maker is a treat for espresso lovers. Whether you are on a road trip or need some coffee to keep you up for work at night, this coffee maker will rejuvenate your mood and keep you fresh for the day that follows. Built with brilliance, this coffee maker has an insulated water reservoir that ensures a splash-free operation and thus, a high level of hygiene. It also has a permanent filter, which is reusable. This adds to the convenience of the user. It is simple to operate as well as safe for use. Also, the durable construction of this coffee maker speaks volumes about its long service life. Lastly, a bold black finish blends in elegantly with the stylish design of this coffee maker.</p> 		</div> 	</div> 	<div class="row"> 		<div class="columns medium-12"> 			<h4><b>Key Features</b></h4> 			<div class="row kf-en"> 				<div class="columns medium-6 small-12"> 					<div class="row"> 						<p class="medium-1 small-1 ic-voltage"></p> 						<p class="medium-10 small-10">330 Watts Power</p> 					</div> 					<div class="row"> 						<p class="medium-1 small-1 fi-info"></p> 						<p class="medium-10 small-10">Plastic Permanent Filter</p> 					</div> 				</div> 				<div class="columns medium-6 small-12"> 					<div class="row"> 						<p class="medium-1 small-1 fi-info"></p> 						<p class="medium-10 small-10">Compact Design</p> 					</div> 					<div class="row"> 						<p class="medium-1 small-1 fi-info"></p> 						<p class="medium-10 small-10">Ceramic Cup</p> 					</div> 				</div> 			</div> 		</div> 	</div> 	   <div class="row mart-20">     <div class="large-6 medium-12 small-12 columns">       <div class="text-center">         <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Black &amp; Decker 1 Cup Coffee Maker 330 Watts" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/black-and-decker/dcm25-b5/1-black-and-decker-1-cup-coffee-maker-330-watts-black.jpg" class="lazy"/></div>     <div class="large-11 medium-11 columns text-center mart-10">         <h4><b>User-friendly Design</b></h4>         <p>The Black and Decker espresso maker comes with a 0.125L ceramic cup and has a 1 cup capacity, which makes it ideal for individual use. Using this coffee maker, you can prepare up to 180mL of espresso in one go. Also, the compact design of this coffee maker ensures that it occupies very little space on a kitchen countertop or any other surface. You can also carry it conveniently in a bag. Thus, whether you are a traveler or an espresso enthusiast, this coffee maker is what you need for a cup of warm, perfect espresso.</p>       </div>     </div>     <div class="large-6 medium-12 small-12 columns">       <div class="text-center">         <img src="https://cf2.s3.souqcdn.com/static/ltr/en/images/lazy.png" alt="Black &amp; Decker 1 Cup Coffee Maker 330 Watts" data-src="https://souqcms.s3.amazonaws.com/spring/images/2018/black-and-decker/dcm25-b5/2-black-and-decker-1-cup-coffee-maker-330-watts-black.jpg" class="lazy"/></div>       <div class="large-11 medium-11 columns text-center mart-10">         <h4><b>Comfort and Convenience</b></h4>         <p>The Black and Decker portable coffee maker is very convenient to maintain. It is equipped with a pull-out filter holder that enables you to clean this espresso maker with remarkable ease. It also features a well-designed covered reservoir to maintain the highest level of hygiene to ensure that the user remains in sound health. Furthermore, this coffee maker also has a permanent filter, which is suitable for long-lasting use and can be used many times.</p>       </div>     </div>   </div>    </div>         ',
